import React from 'react';
import Link  from "next/link";
import AppLayout from "../components/applayout";
import Head from 'next/head';

const Home = () => {
    return (
        <>
            <AppLayout >
                <Link href={"/about"}><a>about</a></Link>
                <div>hi! next</div>
            </AppLayout>
        </>
            );
};
export default Home;
